   { id: 'event-1', Title: 'tytuł-1' },
   { id: 'event-2', Title: 'tytuł-2' },
   { id: 'event-3', Title: 'tytuł-3' },
   { id: 'event-4', Title: 'tytuł-4' },
];

const EventsPage = () => {
   return (
      <>
         <EventsList events={DUMYEVENTS} />
      </>
   );
};

export default EventsPage;
